import {Button, StyleSheet, Text, View} from 'react-native';
import React from 'react';
import {inject, observer} from 'mobx-react';
import {ScreenProps} from 'utils/routing';

type Props = ScreenProps<'Home'>

@inject('authStore')
@observer
export default class HomeScreen extends React.Component<Props> {

  render() {
    return (
      <View>
        <Text>Welcome {this.props.authStore.user.username}</Text>
        <Button title={'My Profile'} onPress={async () => {
          await this.props.navigation.navigate('Profile',{
            username:this.props.authStore.user.username
          })
        }}/>
      </View>
    );
  }
}

const styles = StyleSheet.create({});
